What could be better than an F-22 Raptor image captured by the one and only Mark Fingar @markfingar ?? How about a PAIR of F-22 Raptors in tight formation (extremely RARE)… with both @razzlarson and @cabogunderson “driving” - 🤯🤯🤩🤩— Posted @withregram • @markfingar Never been dun before.

@cabogunderson and @razzlarson left me at a loss for words this afternoon with a spectacular flight. RaZZ got schooled up on the Heritage Flight routine by the master himself before leaving this week. Cabo’s not only a model officer, but a serious class act…not to leave the new guy hanging. 

Also, today, was Cabo’s last “team” thing over US soil. Gonna miss you my friend! The team and your legacy is in great hands!

Now, to roll through an hour’s worth of video and a gagillion photos

@f22demoteam #raptor #f22raptor 

It was amazing watching two Raptors flying the routine several times, as well as some head-to-head demo maneuvers as well!
